        val recyclerView: RecyclerView = findViewById(R.id.recyclerView)
        val adapter = PhotoAdapter(photoList)
        recyclerView.adapter = adapter

        findViewById<TextView>(R.id.gird).setOnClickListener {
            recyclerView.layoutManager = GridLayoutManager(this, 5)
            adapter.notifyDataSetChanged()
        }


        findViewById<TextView>(R.id.linear).setOnClickListener {
            recyclerView.layoutManager =
                LinearLayoutManager(this, LinearLayoutManager.VERTICAL, false)
            adapter.notifyDataSetChanged()
        }

        findViewById<TextView>(R.id.flow).setOnClickListener {
            recyclerView.layoutManager = StaggeredGridLayoutManager(3, LinearLayoutManager.VERTICAL)
            adapter.notifyDataSetChanged()
        }
    }


    class PhotoAdapter(private val photoList: List<String>) :
        RecyclerView.Adapter<PhotoAdapter.PhotoViewHolder>() {

        private var isLoading = false

        lateinit var loadMoreData: () -> Unit

        override fun onCreateViewHolder(parent: ViewGroup, viewType: Int): PhotoViewHolder {
            val itemView =
                LayoutInflater.from(parent.context)
                    .inflate(R.layout.item_double_flow, parent, false)
            return PhotoViewHolder(itemView)
        }

        override fun onBindViewHolder(holder: PhotoViewHolder, position: Int) {
            val photoUrl = photoList[position]
            Glide.with(holder.itemView.context).asBitmap()
                .load(photoUrl)
//                .centerCrop()
                .into(holder.photoImageView)
        }

        override fun getItemCount() = photoList.size

        class PhotoViewHolder(itemView: View) : RecyclerView.ViewHolder(itemView) {
            val photoImageView: ImageView = itemView.findViewById(R.id.photoImageView)
        }
    }

